import "./Description.scss"
import data from "../../data/video-details.json"

function Description() {
  return (
    <div className="container">
      <h1 className="title">{data[0].title}</h1>
      <div className="insights">
        <div className="video-info">
            <span className="video-info__channel">{By `${data[0].channel}`}</span>
            <span className="video-info__date">{data[0].timestamp}</span>
        </div>
        <div className="interactions">
            <span className="interactions__views">{data[0].views}</span>
            <span className="interactions__likes">{data[0].likes}</span>
        </div>
      </div>
    </div>
  );
}

export default Description;
